            <header>
                <div className="container cabecalho">
                    <div className="voltar">
                        <a href='/menu'>Voltar</a>
                    </div>
                    <div className="title">
                        <a href='/menu' className="link-title"><img className={imagemHeader} src={imagemHeader}/></a>
                    </div>
                </div>
            </header>
        )
    }
}
export default Cabecalho
